        pet ={table.pet}
        address = {table.address}
        telephone = {table.telephone}
        gender = {table.gender}
        species = {table.species}/>
        {/* <FinalPage/>
        <SelectPage/>
        <ReserveListTotal/> */}
    </div>
  );
 }

export default App;
